function Desinscription() {
    return(
        <div className="desinscription-container">
            <h1>Se désinscrire</h1>
            <p>Pour vous désinscrire, veuillez contacter notre support client.</p>
            <p>Nous sommes désolés de vous voir partir et espérons vous revoir bientôt !</p>
        </div>
    );
}


export default Desinscription;
